import React from 'react';

import {
	Container,
	Col,
	Row,
	Image,
	Navbar,
	Nav,
	NavDropdown,
	Form,
	FormControl,
	Button
} from 'react-bootstrap';

import Logo from '../images/logoHeader.svg'

export default class Header extends React.Component {
	render() {
		let data = this.props.data;
		return (
			<header fluid>
				<Row d-flex justify-content-around>
					<Navbar className="navbar" sticky="top" variant="light" expand="sm">
						<Navbar.Toggle aria-controls="basic-navbar-nav" />
                    	<Image src={Logo} alt="Daniel RamÃ­rez - logo" />
						<Navbar.Collapse id="basic-navbar-nav">
							<Nav>
								<Nav.Link className="nav-link text-center" href="/">Home</Nav.Link>
								<Nav.Link className="nav-link text-center" href="#banners">Banners</Nav.Link>
								<Nav.Link className="nav-link text-center" href="#resume">Resume</Nav.Link>
							</Nav>
						</Navbar.Collapse>
					</Navbar>
				</Row>
			</header>
		)
	}
}
